export const fetchTeams= () => {
  return (dispatch) => {
    dispatch({ type: 'LOADING_TEAMS'})
    fetch('https://localhost:3000/teams')
    .then(response => response.json())
    .then(responseJSON =>
      dispatch({ 
        type: 'ADD_TEAMS',
        teams: responseJSON
      })
    )
  }
}
